  render() {
    return (
      <div>
        <form onSubmit = {this.submit}>
          <h1>Login</h1>
          <label>Email</label><br />
          <input type = "text" id = "email" placeholder = "e.g@com.au" required
           onChange = {e => this.email = e.target.value} /><br /><br />
